attempts.cypher:
MATCH (p:Pod)-[:BelongsTo]->(ns:Namespace)
WHERE ns['metadata']['name'] = 'storefront'
AND NOT EXISTS { MATCH (d:Deployment)-[:Manages]->(rs:ReplicaSet)-[:Manages]->(p) }
AND NOT EXISTS { MATCH (ss:StatefulSet)-[:Manages]->(p) }
AND NOT EXISTS { MATCH (ds:DaemonSet)-[:Manages]->(p) }
AND NOT EXISTS { MATCH (j:Job)-[:Manages]->(p) }
AND NOT EXISTS { MATCH (rs2:ReplicaSet)-[:Manages]->(p) }
RETURN p['metadata']['name'] AS pod_name

